import Login from "./Login";

const LoginBtn =()=>{
    const [isLogin , setIsLogin] =(true);

    const LoginHandler =()=>{
        setIsLogin(true);
    }

    return(
        <>
             {isLogin &&<Login />}
            <button type="login-link" onClick={LoginHandler} >sign in</button>
        </>
    );
}

export default LoginBtn;
